import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Card';

function project(){
  return (<div class="container-fluid">
  <div class="row">
    <div class="col col-md-3">
      <Card />
    </div>
    <div class="col col-md-6">
      2 of 2
    </div>
    <div class="col col-md-3">
      2 of 2
    </div>
  </div>
</div>);
}

export default project;
